    "aerial-image-taken-over-monte-vista-national-wildlife-refuge-acquired-june-27-1975",nt"isopen":
    false,nt"url": null,nt"notes": "Georeferenced aerial image from June 27th,
    1975, taken over Monte Vista National Wildlife Refuge. Like other historic photos,
    this image allows for interpretation of habitat types on the refuge at that time.
    Change over time estimates can be made from this image using current imagery for
    comparison. This image, along with others, are being used by refuge staff to assist
    in understanding and visualizing the historical content of the lands within the
    refuge and how they have changed. The original aerial photograph was acquired in
    digital form from USGS EarthExplorer for Monte Vista National Wildlife Refuge. Individual
    frames were referenced to the 2009 NAIP color imagery with ArcMap 10.0. The resolution
    of the image is 6 meters. This image should be used for resource-level interpretation
    only.",nt"license_title": "License Not Specified",nt"extras": [{ntt"key":
